
 <template>
	<view class="content">
		<view class="base">
			<image class="back" src="../../static/img/system/fanhui.png" mode="scaleToFill" v-on:click="goBack()"></image>
			<image class="image" :src="songList[nowIndex].InfoCover" mode=""></image>
			<view class="title">{{songList[nowIndex].InfoTitle}}</view>
		</view>
		
		<!-- <video ref="myVideo" class="video"  id="myVideo" :src="src" autoplay="true" 
		@play="onPlay" @pause="onPause" @ended="onEnded"
		 @timeupdate="onTimeupdate" @waiting="onWaiting"
		  @progress="onProgress"
		></video> -->
