			<view class="mark"></view>
		</view>
		
		
		<view class="song-needle" :style="{'margin-top':top - 30 + 'px'}">
			<image class="song-cover-content" src="../../static/img/science/icon_music_needle.png" mode="scaleToFill"
				:draggable="false"></image>
		</view>
		
		<view class="song-top" :style="{'top':top + 10 + 'px'}">
			<view class="song-title">
				<image class="song-title-back" src="../../static/img/home/home_back@2x.png" v-on:click="goBack"></image>
				<view class="song-name">{{songList[nowIndex].InfoTitle}}</view>
			</view>
		</view>

		
		<view class="song-cover">
			<view class="song-cover-disk">
				<image class="song-cover-content" :src="songList[nowIndex].InfoCover" mode="scaleToFill"
					:draggable="false" :class="{'rotate':isScale}" @animationend="reset">
				</image>
			</view>
		</view> -->

		<view class="song-bottom">
			
			<view class="audio-wrapper">
				<view class="audio-number">{{nowtime}}</view>
				<slider class="audio-slider" :value="currentTime" min="0" :max="duration" @change="sliderChange"
					block-size="15"></slider>
				<view class="audio-number">{{alltime}}</view>
			</view>

		
			<view class="audio-control-wrapper">
				<view @tap="updateWay()" v-if="playWay==2 || playWay==1">
					
				</view>
				<view @tap="last()">
					<image class="iconbtn" src="../../static/img/science/icon_music_last.png"></image>
				</view>
				<view @tap="play()"  ref="play" id="playBtn" v-if="playState==1">
					<image class="iconbtn" src="../../static/img/science/icon_music_play.png"></image>
				</view>

				<view @tap="pause()" v-else>
					<image class="iconbtn" src="../../static/img/science/icon_music_pause.png"></image>
				</view>
				<view @tap="next()">
					<image class="iconbtn" src="../../static/img/science/icon_music_next.png"></image>
				</view>
				<view v-show="showCollection()" @tap="save()">
					<!-- <image class="iconbtn" :src="collection(songList[nowIndex].FavoriteStatus)"></image> -->
				</view>
			</view>
		</view>
		<loginModule ref="login" @success="loginSuccess"></loginModule>
	</view>
</template>

<script>
	// #ifdef APP-PLUS
		var AudioManager = uni.getBackgroundAudioManager()		
	// #endif
	// #ifndef APP-PLUS
		var AudioManager = uni.createInnerAudioContext();
		// AudioMannager.autoplay = true
	// #endif
	
	export default {
		data() {
			return {
				playWay: 1,
				playState: 1,
				nowIndex: 0,
				duration: 1,
				currentTime: 0,
				songList: [],
				isScale: false,
				collectionSrc: String,
				src:'',
				top:0,
				fromBanner:false,
				btnEnable:true
			}
		},
		onLoad(option) {
			
			let _this = this;
			//获取缓存的音乐下标
			_this.nowIndex = Number(uni.getStorageSync('musicAcachePosition'))
			
			//获取缓存的音乐列表
			_this.songList = uni.getStorageSync('musicAcacheList')
			console.log(_this.nowIndex)
			console.log(JSON.stringify(_this.songList))
			_this.AudioInnit();	
			this.fromBanner = option.fromBanner
			this.src = this.songList[this.nowIndex].InfoOrigin;
		},
		onShow() {
			let info = uni.getSystemInfoSync()
			this.top = info.safeArea.top	
		},
		onUnload() {
			// console.log("音乐界面关闭 ：" + this.bgAudioMannager)
			this.destroy()
		},
		computed: {
			'nowtime': function() {
				var _this = this;
				var s = _this.currentTime;
				var h;
				h = Math.floor(s / 60);
				s = s % 60;
				h += '';
				s += '';
				h = (h.length == 1) ? '0' + h : h;
				s = (s.length == 1) ? '0' + s : s;
				return h + ':' + s;
			},

			'alltime': function() {
				var _this = this;
				var s = _this.duration;
				
				var h;
				h = Math.floor(s / 60);
				s = s % 60;
				h += '';
				s += '';
				h = (h.length == 1) ? '0' + h : h;
				s = (s.length == 1) ? '0' + s : s;
				if(h == 'NaN'){
					h = '00'
				}
				if(s == 'NaN'){
					s = "00"
				}
				let result =  h + ':' + s;
				// alert(result)
				return result
			},
		},
		methods: {
			//video
			
			
			reset:function(){
				
			},
			loginSuccess:function(){
				
			},
			login:function(){
				let _this = this
					uni.showModal({
						title:"用户未登录",
						content:"检测到您尚未登录，是否去登录？",
						success(e) {
							if(e.confirm == true){							
								_this.$refs.login.showLogin()						
							}
						}
					})				
			},
			goBack: function() {
				console.log("点击返回")
				let _this = this
				uni.$emit('saveMusicData', {
					// msg: _this.songList
				})
				this.navigate.naviBack(1)				
				this.destroy()
			},
			showCollection:function(){
				return (this.config.collection && !this.fromBanner);
			},
			getData:function(){
				return
				let item = this.songList[this.nowIndex]
				let id = item.InfoID
				let _this = this
				this.request.startRequest({
					url:_this.api.PostMusicInfoByID,
					data:{
						"UserID":_this.user.getUserId(),
						"InfoID":id
					}
				}).then(res =>{
					if(res.data.Code == 0){
						var item = _this.songList[_this.nowIndex]
						let newItem = res.data.Data[0]
						item.FavoriteStatus = newItem.FavoriteStatus
						_this.songList.splice(_this.nowIndex,1,item)
					}
				}).catch(reason =>{
					
				})
			},
			collection: function(e) {
				
				if (e == 1) {
					return "../../static/img/science/icon_collection_selected.png"
				} else {
					return "../../static/img/science/icon_collection_unselected.png"
				}
			},
			sliderChange: function(e) {				
				AudioManager.seek(e.detail.value)					
			},
			
			
			AudioInnit: function() {				
				
				var _this = this;
				_this.playState = 1;				
				this.src = _this.songList[_this.nowIndex].InfoOrigin;
				AudioManager.src = this.src
				AudioManager.onPlay(function() {
					// alert("开始播放")
					// uni.hideLoading()
					_this.playFunc()
				});

				AudioManager.onPause(function() {
					_this.pauseFunc()
				});
				AudioManager.onEnded(function() {
					console.log("音乐播放结束")
					_this.next()
				});
				AudioManager.onTimeUpdate(function() {
					
					_this.currentTime = Math.floor(AudioManager.currentTime)
					if(_this.currentTime>0){
						uni.hideLoading()
					}
					if(_this.duration != Math.floor(AudioManager.duration)){
						_this.duration = Math.floor(AudioManager.duration)
					}
					
				});
				

				AudioManager.onWaiting(function() {
					_this.playState = 0
					uni.showLoading({
						title:"加载中..."
					})
				});

				AudioManager.onCanplay(function() {
					_this.duration = Math.floor(AudioManager.duration)
					// AudioManager.play()
					// alert(bgAudioMannager.duration)
					// setTimeout(function(){
					// 	_this.play()
					// 	_this.btnEnable = true
					// },100)
					// alert("开始")
				});						
				this.getData()				
				this.play()
			},
			error: function() {
				this.playState = 0;
			},
			play: function() {
			
				var _this = this;
				// if (bgAudioMannager.src == undefined) {
				// 	_this.bgAudioInnit()
				// };
				_this.isScale = true;
				AudioManager.play();
				uni.showLoading({
					title:"加载中..."
				})
			},
			pause: function() {
				var _this = this;
				_this.isScale = false;
				AudioManager.pause()
			},
			playFunc: function() {
				var _this = this;
				_this.playState = 0;
			},
			pauseFunc: function() {
				var _this = this;
				_this.playState = 1;
			},

			last: function() {
				if(this.btnEnable == false){
					return
				}
				
				var _this = this
				//随机
				if (_this.playWay == 2) {
					_this.nowIndex = Math.floor(Math.random() * this.songList.length);
				} else if (_this.playWay == 1) { //顺序播放
					//顺序
					if (_this.nowIndex < 1) {
						_this.nowIndex = _this.songList.length - 1
					} else {
						_this.nowIndex = _this.nowIndex - 1
					}
				} else { //单曲播放 不做处理

				}

				_this.AudioInnit()
				_this.getData()
				this.btnEnable = false
			},			

			destroy: function() {
				if(AudioManager != "" && AudioManager != undefined && AudioManager != null){
					// AudioManager.stop()
					// #ifdef APP-PLUS
					AudioManager.stop()
					// #endif
					// #ifndef APP-PLUS
					AudioManager.destroy()
					// #endif
					
				}				
			},
			next: function() {
				if(this.btnEnable == false){
					return
				}
				
				var _this = this
				//随机
				if (_this.playWay == 2) {
					_this.nowIndex = Math.floor(Math.random() * this.songList.length);
					this.getData()
				} else if (_this.playWay == 1) { //顺序播放
					//顺序
					if (_this.nowIndex >= (this.songList.length - 1)) {
						_this.nowIndex = 0
					} else {
						_this.nowIndex = _this.nowIndex + 1
					}
				} else { //单曲播放 不做处理

				}
				_this.isScale = false
				_this.AudioInnit()
				_this.getData()
				// this.btnEnable = false
			},

			updateWay: function() {
				var _this = this;
				if (_this.playWay == 2) {
					// _this.playWay = 0;
				} else {
					_this.playWay += 1;
				}
			},

			save: function() {
				var _this = this;
				if (_this.user.getLoginState()) {
					var status = _this.songList[_this.nowIndex].FavoriteStatus;
					if (status == 1) {
						_this.CancleFavorite(status)
					} else if (status == 0) {
						_this.Favorite(status)
					}
				} else {
					//显示登录弹窗

					this.login()
				}

			},

			Favorite: function(status) {
				let _this = this;
				// console.log(getApp().globalData.defaultUser);
				this.request.startRequest({
					url: _this.api.PostFavorite,
					data: [{
						'UserID': _this.user.getUserId(),
						'ObjectID': _this.songList[_this.nowIndex].InfoID,
					}],
					showLoading:true
				}).then(res =>{
					if (res.data.Code == 0) {
						_this.songList[_this.nowIndex].FavoriteStatus = 1
						console.log("收藏成功")
					uni.$emit("collectionStateChange",{})
						uni.setStorageSync('musicAcacheList',_this.songList)
						
					}
				}).catch(reason =>{
					
				})
			
			},
			CancleFavorite: function(status) {
				let _this = this;
				this.request.startRequest({
					url: _this.api.PostCancelFavorite,
					data: [{
						'UserID': _this.user.getUserId(),
						'ObjectID': _this.songList[_this.nowIndex].InfoID,
					}],
					showLoading:true
				}).then(res =>{
					if (res.data.Code == 0) {
						_this.songList[_this.nowIndex].FavoriteStatus = 0
						console.log(JSON.stringify(res.data.Data[0]))
						uni.$emit("collectionStateChange",{})
						uni.setStorageSync('musicAcacheList',_this.songList)
					
					}
				}).catch(reason =>{
					
				})				
			},

			// watch: {
			// 	src(src, old) {
			// 		alert("111")
			// 		bgAudioMannager.src = src
			// 		this.current = 0
			// 		this.duration = 0
			// 		if (old || this.autoplay) {
			// 			bgAudioMannager.play()
			// 		}
			// 	}
			// }
		}
	}
</script> 

